import React from "react";
import GameList from "./components/GameList";

import "./App.scss";

function App() {
  return (
    <div className="App">
      <div className="App__choice">
        <h1 className="App__title">Choose a" game</h1>
        <GameList />
      </div>
    </div>
  );
}

export default App;
